import img1 from '../../image_4.jpg';

import './Project.scss';

export default class Project extends Component{
    render(){
        const { theme, img, name, info } = this.props.project;

        return (

            <article className="project">
                <div className="img-container">
                    <img 
                    src={img} 
                    alt="" 
                    />
                </div>
                <div className="project-info">
                    <h3>{theme}</h3>
                    <h4>{name}</h4>
                    <h5>
                        info{" "} 
                    <span>
                        <i className="fas fa-caret-square-down" />
                    </span>
                    </h5>
                    <p>Creative kids photography in studio. If you would like to have at least a few classy, timeless made images or something extraordinary studio photography is the best choice.</p>
                </div>
            </article>



        )
    }
}
